  background: #0c0c0c;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 0 30px;
  height: 100vh;
  position: relative;
  z-index: 1;
  background: #010606;
`;

export const IsprobajResults = styled.div`
  flex: 0 1 50%;
  min-height: 100%;
  max-width: 50%;
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: repeat(5, 140px);

  @media screen and (max-width: 480px) {
    grid-template-rows: repeat(4, 120px);
